import React, { Component } from 'react';
class Properties extends Component {
  constructor(props) {
    console.log(props.properties);
    super(props);
    this.state = {
      isShow: true,
    };
  }
  render() {
    return (
        <div>
                The data from parent is:{this.props.properties}
        </div>
    );
  }
}
export default Properties;
